import React from 'react'
import './App.css';
import MyNavbar from "./components/Navbar/navbar-comp";
import LandingTitle from "./components/Landing-Title/title";
import About from "./pages/About/about-comp"
import Homeimg from "./components/HomeImg/homeimg";
import Skills from "./pages/Skills/skills_comp";
import { Container } from 'react-bootstrap';
import Particles from "react-particles-js";
import { particlesOptions } from "./particlesOptions";

const App = () => {
  return (
    <div className="App" style={{position: "relative"}}>
      <MyNavbar />
      <Homeimg />
      <LandingTitle />
      <Particles
        className="particles particles-box"
        params={particlesOptions}
      /> 
      <div>
        <Container className="container-box rounded" style={{height: "96vh"}}>
          <hr />
          <About />
        </Container>
      </div>

      <div>
        <Container className="container-box rounded">
          <hr />
          <Skills />
        </Container>
      </div>

    </div>

  );
}

export default App;
